fun Fritz2HeadlessUiDemoAdapter(
    pages: Map<String, playground.fritz2.headlessdemo.Page>,
    fragment: String,
) = Page(
    id = "fritz-headless-ui",
    label = "Headless UI",
    description = "Headless UI showcases by Fritz2",
    icon = fritz2,
    groups = listOf(pages.mapNotNull { (key, page) ->
        when (page) {
            is DemoPage -> {
                val name = page.title.removePrefix("Headless ")
                Page(
                    id = "fritz2-headless-ui-$key",
                    label = name,
                    description = page.description,
                    icon = page.icon,
                    content = {
                        showcase(name, simple = true, classes = "m-16") {
                            div("rounded-xl block overflow-hidden h-full mt-2 ring-8 ring-gray-500/40") {
                                fritz2HeadlessUiDemo(demo = key, fragment = fragment)
                            }
                        }
                    },
                )
            }

            else -> null
        }
    }),
    content = {
        div("rounded-xl block overflow-hidden") {
            fritz2HeadlessUiDemo(demo = "", fragment = fragment)
        }
    }
)

private val fritz2HeadlessUiDemo by lazy { Fritz2HeadlessUiDemo.register("fritz2-showcase", "demo", "fragment") }
private fun RenderContext.fritz2HeadlessUiDemo(
    demo: String,
    fragment: String,
    classes: String? = null,
    id: String? = null,
    scope: (ScopeContext.() -> Unit) = {},
): Tag<HTMLDivElement> {
    addComponentStructureInfo("fritz2HeadlessUiDemo", this@fritz2HeadlessUiDemo.scope, this)
    return fritz2HeadlessUiDemo(this, classes, id, scope) {
        attr("demo", demo)
        attr("fragment", fragment)
    }
}

object Fritz2HeadlessUiDemo : WebComponent<HTMLDivElement>() {
    private val demo: Flow<String> = attributeChanges("demo")
    private val store: Flow<Store<String>> = attributeChanges("fragment").map {
        routerOf(mapOf(it to "overview")).mapByKey(it).map(
            lensOf("prefix", { it.removePrefix("fritz2-headless-ui-") }, { _, demo -> demo.withPrefix("fritz2-headless-ui-") })
        )
    }

    override fun RenderContext.init(element: HTMLElement, shadowRoot: ShadowRoot): HtmlTag<HTMLDivElement> {
        linkStylesheet(shadowRoot, "https://rsms.me/inter/inter.css")
        setStylesheet(shadowRoot, CSS.decodeBase64String())
        return div("bg-radial-at-b from-primary-200 to-primary-400") {
            demo.combine(store, String::to).render { (pageKey, store) ->
                div("p-4", scope = { set(SHOW_COMPONENT_STRUCTURE, true) }) {
                    val page = pages[pageKey]
                    if (page == null) {
                        overview(store)
                    } else {
                        page.content(this)
                    }
                }
            }
        }
    }
}

@Suppress("LongLine")
private const val CSS =
    """"""
